     您可以控制自己的資料。



      您可以透過以下選項，來控制 Adobe 網站使用 Cookie 和類似技術的方式。但請注意，如果您完全停用 Cookie 功能和類似技術，Adobe 網站可能會無法正常運作。





     何謂 Cookie，Adobe 又為何要使用它們？



      Cookie 是網頁瀏覽器在您使用網站時儲存的小型文字檔案。還有其他類似用途的技術，例如 HTML5 本機儲存 (HTML5 Local Storage) 和本機共用物件、Web 信標及內嵌指令碼。這些技術可以幫助我們執行部分操作，例如在您返回我們的網站時記住您和您的偏好設定、評估您使用網站的方式、進行市場調查，以及收集您看到和與之互動的廣告相關資訊。





     我該如何選擇？



      您可以在下方的選單中，選擇從本瀏覽器造訪 Adobe 網站時，希望我們在網站上使用的 Cookie 和其他技術。您之後可以隨時點按頁面底部的 Cookie 偏好設定連結，來變更這些選擇。











   如果啟用：



    我們可以針對我們認為您可能感興趣的內容來量身打造網站和內容，進而改善您的體驗


    我們更能夠追蹤您的偏好設定，例如您喜歡使用哪種語言


    我們會更加瞭解您可能的喜好，以便在非 Adobe 網站上和非 Adobe 應用程式中提供關聯性更高的 Adobe 廣告和內容


    它將幫助我們改善網站效能，以及使用 Adobe Experience Cloud 的合作夥伴的網站效能





   如果停用：



    我們將無法在每次工作階段之間記住您，因此體驗可能無法滿足您的興趣


    您仍然可以存取網站的內容，但是某些依賴 Cookie 的功能可能無法運作


    您仍然會看到廣告，只是它們與您的相關性可能較低







